    // </nav>
    <AppBar>
      <Toolbar>
        <Typography variant="h6">
          Personal CRM
        </Typography>
        <IconButton color="inherit" onClick={onMenuClick("/")}>
          Home
        </IconButton>
        <IconButton color="inherit" onClick={onMenuClick("/login")}>
          Login
        </IconButton>
        <IconButton color="inherit" onClick={onMenuClick("/logout")}>
          Logout
        </IconButton>
        <IconButton color="inherit" onClick={onMenuClick("/contacts")}>
          Contacts
        </IconButton>
      </Toolbar>
    </AppBar>
  );
}
